ces.\r\n                    <br><br></li></ul></li></ul></li>\r\n\r\n    <li>\r\n        Functionality cookies\r\n        <br><br>\r\n        <ul><li>\r\n                Type: Persistent Cookies\r\n                <br><br>\r\n                <ul><li>\r\n                        &nbsp;These cookies allow us to remember choices you make when you use the website, such as remembering your login details or language preference. The purpose of these cookies is to provide you with a more personal experience and to avoid you having to re-enter your preferences every time you use the&nbsp;website.\r\n                    </li></ul></li></ul></li></ul>\r\n\r\n        <p class=\"PolicyPara\" style=\"margin:0px;\"><strong><br>1.3.</strong>\r\n            &nbsp;If you don\'t like the idea of cookies or certain types of cookies, you can change your browser\'s settings to delete cookies that have already been set and to not accept new&nbsp;cookies.\r\n            <br>\r\n            Please note, however, that if you delete cookies or do not accept them, you might not be able to use all of the features the website and services&nbsp;offer.\r\n\r\n            <strong><br><br>1.4.</strong>\r\n            &nbsp;We reserve the right to modify this Policy or its terms relating to the Website and Services at any time, effective upon posting of an updated version of this Policy on the Website. When we do, we will revise the updated date at the bottom of this page. Continued use of the Website and Services after any such changes shall constitute your consent to such&nbsp;changes.\r\n\r\n            <strong><br><br>1.5.</strong>\r\n            &nbsp;You acknowledge that you have read this Policy and agree to all its terms and conditions. By accessing and using the Website and Services you agree to be bound by this Policy. If you do not agree to abide by the terms of this Policy, you are not authorized to access or use the Website and&nbsp;Services.\r\n        </p>\r\n    <br>\r\n    <p class=\"PolicyPara\" style=\"margin:0px;\">This document was last updated on March 1, 2021</p></div>");
